import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('NotoKufiArabic-VariableFont_wght-normal.ttf', font);
this.addFont('NotoKufiArabic-VariableFont_wght-normal.ttf', 'NotoKufiArabic-VariableFont_wght', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
